import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Spinner from './Spinner';
import { ContactServices } from './ContactServices';

const HomePage = () => {
  const navigate = useNavigate();
  const [query, setQuery] = useState({
    text: ""
  });

  const [state, setState] = useState({
    loading: true,
    contacts: [],
    filteredContacts: [],
    errorMassage: ''
  });

  useEffect(() => {
    const fetchContacts = async () => {
      setState({ ...state, loading: true, contacts: [] });
      try {
        const response = await ContactServices.getAllContacts();
        setState({
          ...state,
          loading: false,
          contacts: response.data.data,
          filteredContacts: response.data.data
        });
      } catch (error) {
        setState({ ...state, loading: false, errorMassage: 'Data not found' });
        alert('Data not found');
      }
    };
    fetchContacts();
  }, []);

  // Search contacts
  const searchContact = (event) => {
    setQuery({ ...query, text: event.target.value });

    const filteredContacts = state.contacts.filter((contact) =>
      contact.name.toLowerCase().includes(event.target.value.toLowerCase())
    );
    setState({ ...state, filteredContacts });
  };

  const handleLogout = () => {
    // Clear user session if needed (e.g., remove tokens or session storage)
    navigate('/login');
  };

  const { loading, filteredContacts } = state;

  return (
    <>
      <div className="container p-3">
        <div className="d-flex justify-content-between align-items-center">
          <h2>Home Page</h2>
          <button onClick={handleLogout} className="btn btn-danger">Logout</button>
        </div>
        
        {/* Search Section */}
        <section className="contact-search">
          <div className="container p-3">
            <div className="row">
              <div className="col-md-6">
                <form className="row">
                  <div className="col">
                    <div className="mb-2">
                      <input
                        type="text"
                        name="text"
                        onChange={searchContact}
                        value={query.text}
                        placeholder="Search name"
                        className="form-control"
                      />
                    </div>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </section>

        {/* Contact List Section */}
        {loading ? (
          <Spinner />
        ) : (
          <React.Fragment>
            <section className="contact-list">
              <div className="container">
                <div className="row">
                  {filteredContacts.length > 0 &&
                    filteredContacts.map((contact) => {
                      const { name, dateofbirth, email, id } = contact;
                      return (
                        <div className="col-md-6 mb-4" key={id}>
                          <div className="card d-flex justify-content-around">
                            <div className="card-body">
                              <div className="row align-items-center">
                                <div className="col-md-7">
                                  <ul className="list-group">
                                    <li className="list-group-item list-group-item-action">
                                      Name: {name}
                                    </li>
                                    <li className="list-group-item list-group-item-action">
                                      Date of Birth: {dateofbirth}
                                    </li>
                                    <li className="list-group-item list-group-item-action">
                                      Email: {email}
                                    </li>
                                  </ul>
                                </div>
                              </div>
                            </div>
                          </div>
                        </div>
                      );
                    })}
                </div>
              </div>
            </section>
          </React.Fragment>
        )}
      </div>
    </>
  );
};

export default HomePage;
